import React from 'react';
import { Link } from 'react-scroll';


function Navigation() {
    return <nav>
        <ul>
            <Link
                activeClass="active"
                to="projekty"
                spy={true}
                smooth={true}
                offset={50}
                duration={500}
                onClick={() => { }}
            >pppp</Link>
            <li><a href="1">O mne</a></li>
            <li><a href="2">Moje projekty</a></li>
            <li><a href="3">Moje schopnosti</a></li>
            <li><a href="4">Kontakt</a></li>
        </ul>
    </nav>
}



export default Navigation;
